import React from "react";
import { Link } from "react-router-dom";
import { URLS } from "./../constants/route-links";
import cart from '.././images/icon-cart.svg'

const Navbar = () => {
  return (
    <nav className="w-full absolute top-0 p-5 border ">
      <div className="flex relative  items-center justify-between">
        <div className=" font-bold text-2xl text-Black">
          <Link to={URLS.collections.url}>sneakers</Link>
        </div>
        <div className=" text-DarkGrayishBlue space-x-6">
          <Link
            to={URLS.collections.url}
            className="  hover:border-b-Orange border-b-4 border-transparent pb-6 select-none ease-in-out durarion-300"
          >
            Collections
          </Link>
          <Link
            to={URLS.men.url}
            className="  hover:border-b-Orange border-b-4 border-transparent pb-6 select-none ease-in-out durarion-300"
          >
            Men
          </Link>
          <Link
            to={URLS.women.url}
            className="  hover:border-b-Orange border-b-4 border-transparent pb-6 select-none ease-in-out durarion-300"
          >
            Women{" "}
          </Link>
          <Link
            to={URLS.about.url}
            className="  hover:border-b-Orange border-b-4 border-transparent pb-6 select-none ease-in-out durarion-300"
          >
            About
          </Link>
          <Link
            to={URLS.contact.url}
            className="  hover:border-b-Orange border-b-4 border-transparent pb-6 select-none ease-in-out durarion-300"
          >
            Contact
          </Link>
        </div>
        <div className=" flex items-start space-x-3">
          <a>
          <img src={cart} className="" alt=""></img>
          </a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
